USE 226analysis;

CREATE TABLE medicineOperation(
    medicineId      INT             NOT NULL,
    medicineName    VARCHAR(400)    NOT NULL,
    price           DOUBLE          NOT NULL,
    brandId         INT             NOT NULL,
    storeId         INT             NOT NULL,
    PRIMARY KEY     (medicineId) 
);




CREATE TABLE medicine(
    medicineKey     INT             NOT NULL    AUTO_INCREMENT,
    medicineId      INT             NOT NULL,
    medicineName    VARCHAR(400)    NOT NULL,
    price           DOUBLE          NOT NULL,
    brandId         INT             NOT NULL,
    brandName       VARCHAR(200)    NOT NULL,
    factoryId       INT             NOT NULL,
    factoryName     VARCHAR(200)    NOT NULL,
    PRIMARY KEY     (medicineKey) 
);

CREATE VIEW joinMedicineBrandFactory AS
    SELECT m.medicineId, m.medicineName, m.price, 
           b.brandId, b.brandName,
           f.factoryId, f.factoryName
    FROM   medicineOperation m, brand b, factory f
    WHERE  m.brandId = b.brandId AND b.factoryId = f.factoryId; 

SELECT medicineId, medicineName, price, brandId, brandName, factoryId, factoryName
FROM joinMedicineBrandFactory;
